import React from "react";
import styled from "styled-components";

const WelcomeSection = styled.section`
@import url('https://fonts.googleapis.com/css2?family=Poppins:wght@100;300;400&display=swap');

    position: relative;
    max-width: 1100px;
    display: flex;
    flex-direction: column;
    margin: 0 auto;
    font-family: "Poppins", sans-serif;
    
    h1 {
        font-weight: 400;
        font-size: 3rem;
        margin: 0 0 2rem 0;
    }
    

`
const WelcomeBtn = styled.button`
    width: 8rem;
    margin: 0 auto;
    outline: none;
    cursor: pointer;
    padding: 10px 5px;
    font-family: "Poppins", sans-serif;
    <border-radius></border-radius>;

`

export default function Welcome({ handleClick }) {
  return (
    <WelcomeSection>
      <h1>Welcome to Notes with Nuance</h1>
      <WelcomeBtn onClick={handleClick}>Sign In</WelcomeBtn>
    </WelcomeSection>
  );
}
